import React from "react";

const OrderPage = () => {
    return (
        <div style={styles.orderContainer}>
            <h2>Admin Orders</h2>
            <p>Here you can manage all customer orders.</p>
            {/* Add order details here */}
        </div>
    );
};

const styles = {
    orderContainer: {
        border: "1px solid #ccc",
        padding: "20px",
        borderRadius: "10px",
        marginTop: "20px",
        backgroundColor: "#f9f9f9",
    },
};

export default OrderPage;
